  return (
    <View>
      <Text>Elige una opci√≥n:</Text>
      <Button
        title="Registrar Carros"
        onPress={() => navigation.navigate('RegistroCarros')}
      />
      <Button
        title="Alquilar"
        onPress={() => navigation.navigate('Alquilar')}
      />
    </View>
  );
};

export default ChooseOptionsScreen;
